ScaDaMaLe Course site and book In this notebook we create a code-writing program. Coding a specific motif generally makes for very long strings, the length grows as \(n^2\). Thus coding them directly is very inefficient. We solved this problem via a simple program. Here we can simply feed the adjacancy matrix of the motif we want to find, and it gives us the scala code. import numpy as np In this funtion we input the adjacancy matrix of the motif we want to find. Then it produces the text of a scala command. Than command can then be copy-pasted into another notebook. Here we simply go through the adjacancy matrix and fix the string thereafter. In this function the motif we want to find is induced by the graph. Thus each edge is either wanted or forbidden. loops - Do we care about loops or not. def matrix_to_string(input_matrix, input_function_name, loops = True): ret_string = "def " + input_function_name + "(input_graph: GraphFrame) = {
	val string_" +input_function_name+ " = "" filter_string = "" pos_edges = "" neg_edges = "" alphabet = ['a','b','c','d','e','f','g','h','i','j','k','l','m','n','o','p','q','r','s','t','u','v','w','x','y','z'] for i in range(len(input_matrix)): for j in range(len(input_matrix[i])): if i == j: if loops and input_matrix[i][j] != 0: pos_edges += "(" + alphabet[i] + ")-[]->(" + alphabet[j] + "); " elif loops: neg_edges += "!(" + alphabet[i] + ")-[]->(" + alphabet[j] + "); " elif input_matrix[i][j] != 0: pos_edges += "(" + alphabet[i] + ")-[]->(" + alphabet[j] + "); " else: neg_edges += "!(" + alphabet[i] + ")-[]->(" + alphabet[j] + "); " if i > j: filter_string += ".filter("" + alphabet[j] + ".id != " + alphabet[i] + ".id")" ret_string += pos_edges + neg_edges ret_string = ret_string[0:-2] ret_string += ""
	input_graph.find(g_1)" ret_string += filter_string ret_string += ".count
}
" return ret_string In this funtion we input the signed adjacancy matrix of the motif we want to find. Then it produces the text of a scala command. Than command can then be copy-pasted into another notebook. Here we simply go through the adjacancy matrix and fix the string thereafter. In this function each edge can either be demanded, forbidden, or allowed. The three states are represented by 1, -1, and all other values. loops - Do we care about loops or not. def matrix_to_string_signed(input_matrix, input_function_name): ret_string = "def " + input_function_name + "(input_graph: GraphFrame) = {
