We code the motifs of the simplest complete graphs, we include an edge i->j if i comes before j alphabetically. That is, we code for the edges a->b and a->c but not for c->b. As we will see later the graphs of interest does not contain any loops, thus we do not have to filter the result ensuring that all nodes are distinct. For simplicial abstract complexes these graphs correspond to the faces. Thus counting them corresponds to finding entries in the f-vector. /* ** Two functions counting the number of 2- and 4-dimensional faces of a ** simplicial graphical simplex. It is assumed the the input_graph does
** not contain any loops.
*/ def count_K2(input_graph: GraphFrame): Long = { // Should be the same as the number of edges. input_graph.find("(a)-[]->(b)").count
} def count_K3(input_graph: GraphFrame): Long = { input_graph.find("(a)-[]->(b); (a)-[]->(c); (b)-[]->(c)").count
} def count_K4(input_graph: GraphFrame): Long = { input_graph.find("(a)-[]->(b); (a)-[]->(c); (a)-[]->(d); (b)-[]->(c); (b)-[]->(d); (c)-[]->(d)").count
} count_K2: (input_graph: org.graphframes.GraphFrame)Long
